import styled from "styled-components";

export const PokeListContainer = styled.main`
       height: 200px;
    width: 200px;
    padding: 5px;
    border-radius: 15px;
    background-color: rgba(0,117,190);
    display: grid;
    grid-column: initial;
    box-shadow: 3px 3px 4px 4px rgba(10,40,95);

        & p {
            margin-left: 10px;
            font-size: 16px;
        }
`;
